import React, { Component } from 'react';
import { Bar } from 'react-chartjs-2';

class Chart extends Component {
    constructor(props){
        super(props);
        this.state={
            chartData:{
                labels: ['Virginia', 'Ohio', 'N. California', 'Oregon', 'Mumbai', 'Osaka-Local', 'Seoul', 'Singapore', 'Sydney', 'Tokyo', 'Canada', 'Frankfurt', 'Ireland', 'London', 'Paris', 'Sao Paulo'],
                datasets:[
                    {
                        label: 'Users',
                        data: [
                            423678,
                            566151,
                            136455,
                            674283,
                            872615,
                            876334,
                            9586,
                            9872,
                            1235346,
                            3487,
                            1278,
                            13,
                            8745,
                            358345,
                            52661
                        ],
                        backgroundColor: [
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(54, 162, 235, 0.6)',
                            'rgba(255, 206, 86, 0.6)',
                            'rgba(75, 192, 192, 0.6)',
                            'rgba(153, 102, 255, 0.6)',
                            'rgba(255, 159, 64, 0.6)',
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(255, 206, 86, 0.6)',
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(54, 162, 235, 0.6)',
                        ]
                    }
                ]
            }
        }
    }

    render(){
        return(
                <div className="chart">
                    <Bar 
                    data={this.state.chartData}
                    legendPosition="bottom"
                    />
                </div>
        )
    }
}

export default Chart;
